fn run_simple_test(bf_file: &str, expected_stdout: &str) -> Result<(), Box<dyn std::error::Error>> {
    for test_case in RUN_TYPES {
        let mut cmd = Command::cargo_bin(env!("CARGO_PKG_NAME"))?;
        cmd.arg(test_case).arg(bf_file);
        cmd.assert()
            .success()
            .stdout(predicate::eq(expected_stdout))
            .stderr(predicate::eq(""));
    }

    Ok(())
}

fn prime_factors(mut x: u64) -> Vec<u64> {
    let mut factors = Vec::new();
    if x < 2 {
        factors.push(x);
    } else {
        let mut factor = 2;
        while factor <= x {
            if x % factor == 0 {
                x /= factor;
                factors.push(factor);
                continue;
            }
            match factor {
                2 => factor += 1,
                _ => factor += 2,
            };
        }
    }
    factors
}


#[test]
fn test_factor() -> Result<(), Box<dyn std::error::Error>> {
    for n in 0..=1000 {
        for test_case in RUN_TYPES {
            let mut cmd = Command::cargo_bin(env!("CARGO_PKG_NAME"))?;
            cmd.arg(test_case).arg("examples/factor.bf");
            cmd.write_stdin(format!("{n}\n"));
            cmd.assert()
                .success()
                .stdout(predicate::function(|output: &str| {
                    let mut expected_output = format!("{n}:");
                    for factor in prime_factors(n) {
                        expected_output.push_str(&format!(" {}", factor));
                    }
                    expected_output.push('\n');
                    output == expected_output
                }))
                .stderr(predicate::eq(""));
        }
    }

    Ok(())
}

